import { Fragment } from "react";
import { useParams } from "react-router-dom/cjs/react-router-dom.min";

const QuoteDetails = () => {
  const Params = useParams();
  return (
    <Fragment>
      <h1>{params.quoteId}</h1>;
    </Fragment>
  );
};
export default QuoteDetails;
